import React, { Component } from "react";

class HomeComponent extends Component {
  render() {
    return (
      <div className="d-flex justify-content-center align-items-center home">
        <div className="card">
          <h1 className="display-4 d-flex justify-content-center">Welcome!</h1>
          <div className="card-body">
            Sign in or Sign up to let us help you fly away to your next dream
            destination.
          </div>
          <a href="/sign-in" class="card-link">
            Sign In
          </a>
          <a href="signup" class="card-link">
            Register
          </a>
        </div>
      </div>
    );
  }
}

export default HomeComponent;
